import React, { useContext } from 'react';
import { AppContext } from './EasyLevel';

function Key(keyVal) {
  const { gameOver, onSelectKey, onDelete, onEnter } = useContext(AppContext);
  const { grid, setGrid } = useContext(AppContext);
  const selectKey = () => {
    const newGrid = [...grid];
    newGrid[0][0] = keyVal;
    setGrid(newGrid);
  };
}
export default Key;
